import React from "react";
import { Typography, Box } from "@mui/material";
import PropertySearch from "./PropertySearch";

const Home = () => (
  <Box>
    <Typography variant="h4" mt={2} mb={2}>Поиск жилья в России</Typography>
    <PropertySearch />
    {/* Можно добавить баннеры, описание сервиса и т.д. */}
  </Box>
);

export default Home;
